import React from 'react';
import { useParams } from 'react-router-dom';

const ToonDetailPage = () => {
    const { id } = useParams();
    return(
        <React.Fragment>
            <h1>This is {id}.</h1>
        </React.Fragment>
    );
}
export default ToonDetailPage;
